import { Book } from "lucide-react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

function Navbars() {
  return (
    <Navbar
      expand="lg"
      className="navbar-light shadow-sm"
      style={{ backgroundColor: "#f0f7ff" }}
    >
      <Container>
        <Link
          to="/"
          className="navbar-brand d-flex align-items-center"
          style={{ textDecoration: "none", color: "#333" }}
        >
          <Book className="me-2" size={24} />
          <h4 className="mb-0 fw-bold">Book Summary App</h4>
        </Link>

        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
          <Nav>
            <Link to="/" className="nav-link mx-2 fw-medium">
              Home
            </Link>
            <Link to="/about" className="nav-link mx-2 fw-medium">
              About
            </Link>
            <Link to="/summaries" className="btn btn-primary ms-2 fw-medium">
              Browse Summaries
            </Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Navbars;
